import React from 'react'
import { Link } from "react-router-dom";


export default function Header() {
    return (
      <div className="NavBar">
        <ul>
          <li>
            <Link to="/">HOME</Link>
            <i class="fas fa-book"></i>
          </li>
          <li>
            <Link to="/about">about</Link>
          </li>
          <li>
            <Link to="/books">Books</Link>
          </li>
        </ul>
      </div>
    );
}
